import "./homepage.css";

const Homepage = () => {
  return (
    <section className="homepage-section">
      <div className="homepage-hero">
          <div className="hero-text">
              <div className="textbox">
                  <div className="title">TRADEPLAY</div>
              </div>
          </div>
      </div>
      <div className="homepage-videos"></div>
      <div className="homepage-categories"></div>
    </section>
  );
};

export { Homepage };
